export default function generateQuote(quoteList: string[]) : CallableFunction{
    const {length : listLength} = quoteList
    const randomIndex = Math.ceil(Math.random() * listLength);
    const quote : string = quoteList[randomIndex]
    return function(){
        return quote
    }
}
